import React from "react";

function NavBar() {
  const menubar = () => {
    function menubar() {
      var hihu = document.querySelector(".menu-data");
      var element = document.getElementById("Menu-bar");

      if (hihu) {
        hihu.classList.remove("animate__fadeOut");
        element.style.display = "none";
        hihu.style.zIndex = "1";
        hihu.classList.add("animate__fadeIn");
      }
    }
    document.getElementById("menu-time").style.transform = "translate(0)";
  };

  const closebar = () => {
    // Add your close logic here
    document.getElementById("menu-time").style.transform = "translate(-100%)";
  };

  return (
    <div>
      <nav className="navbar">
        <div className="data-container">
          <img
            src="https://i.ibb.co/kGbqdSB/NEW-2.png"
            className="Logo"
            alt="Logo"
          />
          <div id="menu-time" className="menu-data animate__animated">
            <a onClick={closebar}>
              <i id="close" className="size fa-solid fa-xmark"></i>
            </a>
            <a href="">Home</a>
            <a href="">About Us</a>
            <a href="">Search</a>
            <a href="">Dropdown</a>
            <a href="">Chiku</a>
          </div>
          <a id="Menu-bar" onClick={menubar}>
            <i className="size-icon fa-solid fa-bars"></i>
          </a>
        </div>
      </nav>
    </div>
  );
}

export default NavBar;
